import { APIService } from '@ohrm/core/util/services/api.service';
export default {
  name: 'Autocomplete',
  props: {
    params: {
      type: Object,
      default: () => ({})
    },
    apiPath: {
      type: String,
      default: '/api/v2/time/project/users'
    }
  },
  setup(props) {
    const http = new APIService(window.appGlobal.baseUrl, props.apiPath);
    return {
      http
    };
  },
  methods: {
    async loadEmployees(serachParam) {
      return new Promise(resolve => {
        if (serachParam.trim()) {
          this.http.getAll({
            nameOrId: serachParam.trim(),
            ...this.params
          }).then(({
            data
          }) => {
            resolve(data.data.map(employee => {
              // console.log(data,'received data');
              return {
                id: employee.empNumber,
                label: `${employee.firstName} ${employee.middleName} ${employee.lastName}`,
                _employee: employee,
                isPastEmployee: employee.terminationId ? true : false
              };
            }));
          });
        } else {
          resolve([]);
        }
      });
    }
  }
};
